To investigate the electrocatalytic activity of kesterite CXTS CEs for reducing iodide electrolyte, we performed Tafel polarization measurements with the symmetrical structure (CE//electrolyte//CE). The exchange current density (J0) of CEs could be acquired from the intercept of a tangent to Tafel polarization curves (Tafel), the variation of which could be inverse with the charge-transfer resistance (Rct) values fitted from EIS through eq. 1:1J0=RTnFRct\documentclass[12pt]{minimal}
