				\setlength{\oddsidemargin}{-69pt}
				\begin{document}$${J}_{0}=\frac{RT\,}{nF{R}_{{\rm{ct}}}}$$\end{document}where R is the gas constant, T is the temperature, F is Faraday’s constant and n is the electron number involved in the electrochemical reduction of triiodides at the electrode56. As shown in Fig. 2(a), the anodic and cathodic branches of CCTS- and CNTS-Tafel curves exhibited larger slopes than those of CZTS, revealing a higher J0 and more efficient catalytic activity of CCTS and CNTS CEs for reducing triiodides. In addition, we also prepared Cu2MnSnS4 and Cu2FeSnS4 CEs by similar method. However, their performance was poor because of the bad activity and unstable chemical property of these two films.Figure 2
(a) Tafel curves and (b) EIS plots of Pt and CXTS CEs. Both Tafel and EIS experiments were performed with the symmetrical dummy cells with two identical electrodes (CE//iodide electrolyte//CE). Inset in a and b show the original Tafel curves and the equivalent circuit model of the symmetrical cells for fitting EIS results. (c) J–V curves of DSSCs based on Pt and CXTS CEs, measured under AM 1.5 G solar simulator illumination (100 mW cm−2).

