Furthermore, we compared the amounts of I atom adsorbed on the CXTS surface by XPS57–60 (see Fig. S6 in the Supplementary Information and Fig. 4). We immersed CXTS CEs in the iodide electrolyte for 30 minutes and rinsed them with ethanol. The peak area ratio of I 3d to Cu 2p spectra was marked as the normalized peak area of I 3d spectra. No signals of I 3d were found in XPS results before immersing. But, after immersing, the normalized peak area of I 3d spectra of CCTS (0.1894) and CNTS (0.1621) were significantly larger than that of CZTS (0.0443) (Fig. 4(b)), indicating more I atom adsorbed on CCTS and CNTS CEs surface. This change was consistent with the enhanced EadI\documentclass[12pt]{minimal}
