				\begin{document}$${{\rm{E}}}_{ad}^{{\rm{I}}}$$\end{document} values and decreased bond length. The electrochemical, photovoltaic and theoretical results all indicated that the substitution of Zn2+ by Co2+ and Ni2+ was effective to improve the catalytic activity of kesterite CZTS.Figure 4
(a) I 3d, Zn 2p, Co 2p and Ni 2p XPS spectra of CXTS CEs before and after immersing in the iodide electrolyte for 30 minutes. (b) The normalized peak area of I 3d XPS spectra of CXTS CEs after immersing in the iodide electrolyte for 30 minutes and (c) the decrease of peak area of X 2p3/2 XPS spectra of CXTS CEs after immersing.

In conclusion, we proved that the substitution of Zn2+ by Co2+ and Ni2+ was a convenient but effective approach to enhance the electrocatalytic performance of kesterite CZTS CEs in DSSCs. After substitution, CCTS and CNTS CEs exhibited decreased charge transfer resistance (CCTS, 5.3 Ω; CNTS, 5.5 Ω; CZTS, 6.5 Ω) and improved electrocatalytic activity (PCE: CCTS, 8.3%; CNTS, 8.2%) compared with CZTS (7.9%) toward iodide electrolyte, which was comparable with the traditional Pt-based cells (8.3%). The enhanced activity was associated to the change of adsorption and desorption energy (the bond length between I atom and metal ions for the transition state (dI-MTS\documentclass[12pt]{minimal}
				\usepackage{amsmath}
				\usepackage{wasysym}
				\usepackage{amsfonts}
				\usepackage{amssymb}
				\usepackage{amsbsy}
				\usepackage{mathrsfs}
				\usepackage{upgreek}
				\setlength{\oddsidemargin}{-69pt}
				\begin{document}$${{\rm{d}}}_{I-M}^{{\rm{TS}}}$$\end{document}) of I atom by theoretical calculation. Furthermore, the stability of kesterite CXTS CEs was also significantly improved. The results indicated that this element substitution method without changing the materials structure was effective to improve potential catalysts performance, especially for the multicomponent compounds.
